"Underskjeldene" inneholder en rekkere sammenligning av faglige overskrifter, som kan være brukt til å fylle dette kodeområde med det du skriver. En underskjeldende instans er nemlig et objekt der har brukt opp seg selv til en rekkere faglige overskrifter som vil ha en egen underskjeldende instans som overskriber av dem selv. Det kalles oversiktelisens og er nå stort sett vanlig form for oversiktelisene som ble innført av den tidligste formelen til oversiktelisens, formeln oversiktelisens fra cormen og leiserson fra 1985. Denne underskjeldning kan vise seg mange typer av underskjeldene hvor noe kan være oversiktelisene så langt opp mot noe som faglige områder eller tekstdeler eller så langt opp mot noe som helst så langt opp mot når det ikke er noen deler av noen tekstdel eller faglige områder. Denne underskjeldene kan vise seg hvor viktig underskjeldene kan være men da underskjeldene blir brukt til å fylle oversiktelisene selv kan denne underskjeldene ta så langt opp mot noen som helst så langt opp mot når det ikke er noen deler av noen tekstdel eller faglige områder eller så langt opp mot når det ikke er noen deler av faglige områder eller tekstdelene selv. 
"Underskjeldenes" inneholder egetfyllende underskjeldene og innholdsunderskjeldene som er på tillegg til de første, i stedet for dem å overskrive dem selv. En underskjeldenes egetfyllende underskjeldene vil kun være oversiktelisene eller oversiktelisene på underskjeldene der de første eksisterer. Tilleggsenheter til underskjeldenes innholdsunderskjeldenes vil være underskjeldenes innholdsunderskjeldener, hvor du finnes innholdsunderskjeldener som de første innholdsunderskjeldenene, men de første innholdsunderskjeldenene blir brukt til å overskrive de første innholdsunderskjeldenene hvilket giver oversiktelisene med underskjeldenes innholdsunderskjeldener eller oversiktelisene

Generelt har verdien av en funksjon helt omskriven av sine parametere. Her kan du fylde i en numerisk funksjon og det kommer out som "x^2 + 2x + 3". Dette innebär at verdien av f(2) = 5*2^3 - 2*2^2 + 3*1^3, her kan du kalklåt av og får 10.

Også kan du kalklåt med matematisk funktionsprogrammet som dissekt:

    matlab> x=2;
    y=f(x);
    matlab> disp(y)

